import React, { useState, useEffect } from 'react';
import { useParams } from 'react-router-dom';

const FacultyDetail = () => {
    const [faculty, setFaculty] = useState(null);
    const { username } = useParams(); // Get the username from the URL

    useEffect(() => {
        fetch(`http://localhost:3001/api/faculty/${username}`)
            .then(response => {
                if (!response.ok) {
                    throw new Error('Network response was not ok');
                }
                return response.json();
            })
            .then(data => {
                setFaculty(data);
            })
            .catch(error => {
                console.error('Fetch error:', error);
            });
    }, [username]); // useEffect should run when username changes

    if (!faculty) {
        return <div>Loading...</div>;
    }

    return (
        <div>
            <h2>{faculty.name}</h2>
            {/* Render other faculty details here */}
        </div>
    );
};

export default FacultyProfileDetail;
